import React from "react";
import styled from "styled-components";

const Input = styled.input`
  font-size: 1.2rem;
  padding: 8px;
`;
interface props {
  value: string;
  onChange
}

const TextInput = ({ value, onChange }: props) => {
  return <Input />;
};

export default TextInput;
